//1.3滚动测量
//1.3滚动测量
float  rolling_distance_M(float angel_y,int init) {
	//此函数求距离

	//static float distance=(360-(angel_x+180))*3.1415926535*6.6/360.0;

    static float angel_init = 0;
    static float distance = 0;
    static float quanshu = 0;
   static int location=0;//等于1代表刚刚通过高触发，等于0代表通过低触发
static int location_init=0;//第一次触发的位置
static int chufa_done=0;//0代表没有触发过，1代表触发过
static int is_init_location_init=0;//0代表没有触发过，1代表触发过
//初始值设定
	if (init == 1)
	{
        angel_init = angel_y;
        distance=0;
        location=0;
        quanshu = 0;
        location_init=0;
        is_init_location_init=0;
	}
	
	//通过90°
    if(angel_y>75&&location==0){
        location=1;
        quanshu=quanshu+0.5;
        chufa_done=1;
    }
		//通过-90°
		else if(angel_y<-75&&location==1){
        location=0;
        quanshu=quanshu+0.5;
        chufa_done=1;
    }
		
//距离的计算
    distance=quanshu*6.6*3.1415926;
    if(location_init==1){
    distance+=(90-angel_init)/360.0*6.6*3.1415926;
    }
    else{
    distance+=(90+angel_init)/360.0*6.6*3.1415926;
    }
        if(location==1){
    distance+=(90-angel_y)/360.0*6.6*3.1415926;
    }
    else{
      distance+=(90+angel_y)/360.0*6.6*3.1415926;  
    }
    
    if(chufa_done==1&&is_init_location_init==0){
        
        location_init=location;
        is_init_location_init=1;
    }
    
	return distance;
}
//2.1水平转动圈数测量
float rotation_M(float angel_z,int init) {
	//此函数求转的圈数量

	//static float distance=(360-(angel_x+180))*3.1415926535*6.6/360.0;
	static float angel_all = 0;
	static float angel_last = 0;
	static float angel_init=0;
	static int zhengzhuan=0;
	static int fanzhuan=0;
	static int quanshu=0;
    float qs_end;
	if (init == 1)
	{
        quanshu=0;
		angel_last = angel_z;
        angel_all=0;
       zhengzhuan=0;
		fanzhuan=0;
		angel_init=angel_z;
	}
	//是否需要判断
	if(zhengzhuan!=1&&fanzhuan!=1){
		
	//正转判断
    if(angel_z-angel_last<-120){

        
        zhengzhuan=1;
        quanshu=quanshu+1;
    }
	//反转判断
    else if(angel_z-angel_last>120){
      
			fanzhuan=1;
			quanshu=quanshu+1;
    }
	}
	
	//正转反转分别积累圈数
	
		if(zhengzhuan==1&&(angel_z-angel_last)<-120){
		quanshu=quanshu+1;
		}
		else if(fanzhuan==1&&(angel_z-angel_last)>120){
		quanshu=quanshu+1;
		}
	
	//计算正转反转结果
	
		if(zhengzhuan==1){
		angel_all=quanshu*360+angel_z-angel_init;
		}
		else if(fanzhuan==1){
		angel_all=angel_z-quanshu*360-angel_init;
		}
        
        //记录上一个点
        angel_last = angel_z;
        
        qs_end = angel_all/360.0;
        //修正
        if(qs_end < -1){
            qs_end += 1.0;
        } else if (qs_end > 1) {
            qs_end -= 1.0;
        } else {
        }
        
	return qs_end;
}

